signal = ""
letter_block_length = 4
print(len(signal))

i = 0
while i < len(signal):
    count = 0
    for j in range(i, i + letter_block_length):
        for p in range(j + 1, i + letter_block_length):
            print(i, j, p, signal[j], signal[p])
            if signal[j] == signal[p]:
                print(i, " No signal")
                count = 0
                i = i + 1
            else:
                count = count + 1
                if count == 4:
                    print(count, i)
                    break
    i = i + 1




